DROP TABLE IF EXISTS `stf2_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `stf2_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stf2_file` varchar(255) NOT NULL,
  `csv_file` varchar(255) DEFAULT NULL,
  `pre_analysis_csv_file` varchar(255) DEFAULT NULL,
  `analysis_csv_file` varchar(255) DEFAULT NULL,
  `status` enum('uploaded','converted_to_csv','analysis_csv_generated','roster_parsed','grading_parsed','grading_inserted','analysis_inserted','completed','error') NOT NULL DEFAULT 'uploaded',
  `institution_id` int(11) DEFAULT NULL,
  `organization_id` int(11) DEFAULT NULL,
  `assessment_id` int(11) DEFAULT NULL,
  `class_room_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `pen_id` varchar(255) DEFAULT NULL,
  `error_log` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `createdAt` datetime NOT NULL DEFAULT current_timestamp(),
  `updatedAt` datetime NOT NULL DEFAULT current_timestamp(),
  `request_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `override_params` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `assessment_id` (`assessment_id`),
  KEY `class_room_id` (`class_room_id`),
  KEY `user_id` (`user_id`),
  KEY `stf2_log_organization_id_foreign_idx` (`organization_id`),
  KEY `stf2_log_institution_id_foreign_idx` (`institution_id`),
  CONSTRAINT `stf2_log_ibfk_1` FOREIGN KEY (`assessment_id`) REFERENCES `assessment` (`id`),
  CONSTRAINT `stf2_log_ibfk_2` FOREIGN KEY (`class_room_id`) REFERENCES `class_room` (`id`),
  CONSTRAINT `stf2_log_ibfk_3` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `stf2_log_institution_id_foreign_idx` FOREIGN KEY (`institution_id`) REFERENCES `institution` (`id`),
  CONSTRAINT `stf2_log_organization_id_foreign_idx` FOREIGN KEY (`organization_id`) REFERENCES `organization` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=82951 DEFAULT CHARSET=utf8;
